import React, { Component } from 'react'

export default class Box extends Component {
  constructor(props) {
		super(props);
		this.state = {
			clicked: false,
		};

  }

  render() {
    const item = this.props.item
    return (
      <div className="box" style={{backgroundColor: item.color, width: '100px'}} onClick={() => this.props.openProject(item.id)}>
        <img className="box_image" src={item.imageUrl} alt=""/>
      </div>
    )
  }
}
